Information
------------------------------

The Battle of the Alamo
The Republic of Texas began the fight for independence in 1833. For several years, Texans fought the Mexican government for the right to rule itself. One of the historical battles was fought on March 6, 1836, at the Alamo, a crumbling fort defended by 154 men. Stand with the defenders in what became a symbol of Texan courage and sacrifice in this impressive graphic Documentary

